    false,nt"url": null,nt"notes": "This Environmental Assessment (EA) discusses
    three alternatives for the Greater Sand Dunes National Park and Preserve, Baca National
    Wildlife Refuge and Medano-Zapata Ranch Fire Management Plan. The EA is being prepared
    in compliance with the National Environmental Policy Act (NEPA) and the Council
    on Environmental Quality (CEQ) Regulations (40 CPR Parts1500 -1508). This EA provides
    a description of the purpose and need for the project, a brief background, the features
    of each alternative, the affected environment, and resulting effects and consequences
    of each alternative. The agency's preferred alternative is indicated in this document.
     The three fire management alternatives are analyzed in this environmental assessment
    / assessment of effect. These include a no action/fire suppression alternative (Alternative
    1), a fire suppression and fuels management alternative (Alternative 2), and a fire
    suppression, fuels management, and wildland fire use alternative (Alternative 3),
     which is the preferred alternative. Mitigation actions proposed in this document
    wouldreduce the likelihood of adverse impacts to cultural, natural, and human resources.",nt"owner_org":
